import { Choix } from "./../../Composant/jsx/comp_choix";
import {ReactComponent as ReactLogo} from './../../assets/img/choix2.svg';
function Back_office() {
    return <>
        <div className="box-back-office">
            <ReactLogo/>
            <Choix titre={"Gestion RH"} description={"Gérer les cv, les tests et les entretients des candidats"} />
        </div>

    </>
}
export default Back_office
